import React from 'react';
import './App.css';
import Map from './components/Map'; 
import { RenderAfterNavermapsLoaded} from 'react-naver-maps'; // 패키지 불러오기
//import HttpsRedirect from 'react-https-redirect';




class App extends React.Component { 
	constructor(props) {

		super(props);
		//console.log("BORN!");

	}
	state = {
		count: 0,

		isLoading: true
	};

	add = () => {
		//console.log("add");
		this.setState(current => ({
			count: current.count +1
		}));
	};

	minus= () => {
		//console.log("add");
		this.setState(current => ({
			count: current.count -1
		}));
	};


	componentDidMount(){
		//console.log('component rendered!');
		setTimeout(() => {
			this.setState({ isLoading: false});
		}, 2000);

	}
	componentDidUpdate(){
		console.log('i just updated!');
	}
	render() {
		//console.log('i am rendering');
		const { isLoading } = this.state;

		return (
 //     <HttpsRedirect>
			<RenderAfterNavermapsLoaded
				ncpClientId={'r7dvstqo0s'} // 자신의 네이버 계정에서 발급받은 Client ID
				error={<p>Maps Load Error</p>}
				loading={<p>Maps Loading...</p>}
			>
				<div id="container">
					<div className="menu_div">
						<img src="/images/ui/menu/hamburger.svg" className="menu_hamburger" alt="menu"></img>
						<img src="/images/ui/menu/activate.svg" className="menu_activate" alt="menu"></img>

					</div>

					<div className="info_div">
						<p className="info_p"> 혼잡도 </p>	
						<img src="/images/ui/info/green.svg" className="info_color" alt="green"></img>
						<img src="/images/ui/info/busy1.svg" alt="green"></img>
						<img src="/images/ui/info/yellow.svg" className="info_color" alt="green"></img>
						<img src="/images/ui/info/busy2.svg" alt="green"></img>
						<img src="/images/ui/info/red.svg" className="info_color" alt="green"></img>
						<img src="/images/ui/info/busy3.svg" alt="green"></img>
					</div>
					<Map/>

					<div className="search_group">
						<div className="line"> </div>
						<div className="search_bar">
							<button type="button" className="search_btn"> </button>
							<div className="input_wrap">
							<input type="text" className="search_input" placeholder="위치를 검색해주세요"></input>
							</div>

						</div>
						<div className="filter_group">

							<div className="filter_div">
								<img src="/images/ui/s1_b.svg" alt="green"></img>
								<p>10명 규모</p>
							</div>
							<div className="filter_div">
								<img src="/images/ui/s2_b.svg" alt="green"></img>
								<p>10 - 20명 규모</p>
							</div>
							<div className="filter_div">
								<img src="/images/ui/s3_b.svg" alt="green"></img>
									<p>30명 이상</p>
							</div>

						</div>
						<div className="filter_instruction_div">
							<p >원하시는 카페 규모를 선택해주세요</p>
						</div>
					</div>
				</div>
			</RenderAfterNavermapsLoaded>
//    </HttpsRedirect>
		);
	}
}

